import Axios from 'axios';
import React, { Component } from 'react';
import axios from 'axios';

export default class Home extends Component {

    state = {

    };

    componentDidMount() {
        const config = {
            headers: {
                Authorization: 'Bearer ' + localStorage.getItem('token')
            }
        };

        axios.get('user', config).then(
            res => {
                this.setState({
                    user: res.data
                });
            },
            err => {
                console.log(err);
            }
        )
    };

    render() {

        return (
            <h2>You are not logged in</h2>
        )
    }
}
